  return (
    <>
      <div className="px-4 productGroupManagement">
        <UpperPartPages title="ŸÖÿØ€åÿ±€åÿ™ ÿ™ÿÆŸÅ€åŸÅ Ÿáÿß" />
        <div className="pt-5 ">
          <Reusable_table
            nameOfColumn={header_colorTable}
            dataOfRows={data}
            placeholder_searchBox="ŸÇÿ≥ŸÖÿ™€å ÿßÿ≤ ÿπŸÜŸàÿßŸÜ ÿ±ÿß Ÿàÿßÿ±ÿØ ⁄©ŸÜ€åÿØ"
            additionField={additionField}
            having_searchBox={true}
            operation={true}
            show_compo={true}
          />
        </div>
      </div>
    </>
  );
};
